import React from 'react'
import Grid from '@material-ui/core/Grid'
import {useSelector} from 'react-redux'

const Content = (props) => {

    const {images} = useSelector(state=>state.picture)
    
    console.log(images)
    
    const createImages = images.map((val)=><img src={val} className='img-content' />)

    return (
        <Grid item xs={10} 
            className='content-con'>
            <Grid
                className='content'
                container
                direction="column"
                justify="flex-start"
                alignItems="stretch">
                {createImages}
            </Grid>
        </Grid>
    )
}

export default Content
